      if exists(c, venue)
        temp.push(venue[0])
      end
    end
    v[c] = temp
  end
  v
end

def gen_venues_for_code
  temp = []
  for day in 1..5
    if day == 1
      for time in (1000..1845).step(50)
        my_hash = gen_venue_array(time, day) # {}
        temp.push(my_hash)
      end
    else #its not monday
      for time in (800..1845).step(50)
        my_hash = gen_venue_array(time, day) # {}
        temp.push(my_hash)
      end
    end
  end
  return temp
end

