  # puts '----------------------code'
    @sorted_array.each do |venue|
      i = 0
      code.each do |c|
        if i == 0    #TODO find out why does it put all when i swap i and if
          if(exists(c, venue) == false)
           temp.push(venue[0])
           i += 1
         else
           break
         end
        end
      end
  end
  temp
end

